import api from "../apis/api";

export const logIn = formVaulues => async (dispatch) => {
  console.log(formValues.email);
  const response = await api.post('login', { formVaulues});
  dispatch({
    type: 'LOG_IN',
    payload: response
  });
  console.log(response);
};
